import React from "react";
import "./Footer.css";
import images from "../../constant/images";
const Footer = () => {
  return (
    <div className="footer_main">
      <div>
        <img src={images.plastapslogo} className="plastaps_logo" />
      </div>
      <div className="store_btn">
        <div>
          <img
            src={images.GPlaystore}
            style={{ height: "49px", marginRight: "20px" }}
          />
        </div>
        <div>
          <img src={images.AppStore} />
        </div>
      </div>
    </div>
  );
};

export default Footer;
